import React from 'react';

const AboutMe = () => {
    return (
        <div className='about-me-page'>
            <h2>Who am I?</h2>
            <h2>I am a 'junior' <a href='https://dictionary.cambridge.org/dictionary/english/polymath' rel='noopener noreferrer' target='_blank'>polymath</a>, but I still have much to learn.</h2>
            <h2>I am a Physiologist. I am a Web Developer. I am a Teacher. I am a sports & exercise fanatic.</h2>
            <h2>My personality assessment suggests that I am heavily concerned with 'people mastery'.</h2>
            <h2>I love everything about the natural world.</h2>
            <h2>I am fascinated by everything about the 'unnatural', human world.</h2>
            <h2>I believe that doing good brings happiness, and I strive for both.</h2>
            <h2>I made this website.</h2>
            <h2>I hope you like it.</h2>
        </div>
    )
}

export default AboutMe;
